import React from 'react'
import { useState } from 'react'

const Join = () => {

   const[newinput, setnewinput] = useState({
     firstName: '',
     lastName: '',
     createid:'',
     password:'',
     mobile:''
   })

   const inputChange = (e) => {
          console.log(e);
   }


    return (
        <>
          <div className='login'>
            <div className='main_inputs'>
                  <input type='text' placeholder='First Name' value={newinput.firstName} name='' onChange={inputChange}/><br />
                  <input type='text' placeholder='Last Name' value={newinput.lastName} name='' onChange={inputChange}/><br />
                  <input type='text' placeholder='Create UserId' value={newinput.createid} name='' onChange={inputChange}/><br />
                  <input type='password' placeholder='Create Password' value={newinput.password} name='' onChange={inputChange}/><br />
                  <input type='password' placeholder='Confirm Password' value={newinput.password} name='' onChange={inputChange}/><br />
                  <input type='text' placeholder='Mobile No.' value={newinput.mobile} name='' onChange={inputChange}/><br />
                 <button>Join</button>
            </div>
          
          </div>
        </>
    )
}

export default Join
